import React from 'react';
import './header.scss';
import { Link } from "react-router-dom";

function Home() {
  return (
    <div className="App">
      <main className="App-home">
        <ul>
          <li>
            <Link to="/">Home</Link>
          </li>
          <li>
            <Link to="about">About</Link>
          </li>
        </ul>
        <h1>MLI</h1>
      </main>
    </div>
  );
}

export default Home;
